/*
	
    SETUP 

	Uploading our data 

  CONTEXT
  You'll be playing the role of a data analyst joining the Ryal Bank of Australia 

  The data loaded is the bank's relational database. It's valuable to the bank in terms of providing insight on growing the business, and serving customers better.

  It consists of 5 tables. 
    
*/

##################################################################
#####################    UPLOADING OUR DATA  #####################
##################################################################
-- CREATING THE DATABASE
CREATE DATABASE ROYAL_BANK_AUS 
;


######### CREATING THE EMPTY TABLES #########

-- Customer
-- DROP TABLE ROYAL_BANK_AUS.CUST_BASE;
CREATE TABLE ROYAL_BANK_AUS.CUST_BASE
(
    CUST_I INT PRIMARY KEY
  , SUR_NAME VARCHAR(100)
  , FRST_NAME VARCHAR(100)
  , CUST_TYPE VARCHAR(1)
  , BRTH_DATE DATE 
  , JOIN_DATE DATE 
  , STATE VARCHAR(3)
  , CLST_BRCH VARCHAR(200) -- closest branch
  , BRCH_CUST VARCHAR (1) -- do they visit the branch
  , DIGI_CUST VARCHAR (1) -- have they logged in online / app
  , APPL_PAY_ACTV_F VARCHAR (1)-- have they activated apple pay
  , FWB_NOTF_ACTV_F VARCHAR (1) -- have they opted into financial well being notifications 
  , MRKT_DNC_F VARCHAR (1) -- have they opted out of marketing
  , RVNU_YEAR_A INT -- what revenue they're worth to the bank every year
  , SLRY_YEAR_A INT NULL 
)
;


-- Customer account link
-- allows us to link between customers and accounts
-- it contains some information that pertains specifically to both customers and accounts and the relationship between them
-- especially useful for summarizing low level information about accounts, transactions, application and phone calls up to the customer level
-- DROP TABLE ROYAL_BANK_AUS.CUST_ACCT;
CREATE TABLE ROYAL_BANK_AUS.CUST_ACCT
(
    ACCT_I INT PRIMARY KEY -- unique account
  , CUST_I INT  -- the customer is repeated in several rows. can have several accounts
  , CUST_ACCT_REL VARCHAR (100) -- customer relationship with the account
)
;


-- Account 
-- contains all the account on book
-- useful for understanding how people are using each of our accounts and products
-- DROP TABLE ROYAL_BANK_AUS.ACCT_BASE;
CREATE TABLE ROYAL_BANK_AUS.ACCT_BASE
(
    ACCT_I VARCHAR(4) PRIMARY KEY
  , OPEN_D DATE
  , CLSE_D DATE -- 9999 not closed yet
  , PDCT_TYPE_C	VARCHAR (10)  -- product type
  , OPEN_CHNL VARCHAR (100)	 
  , ASST_OPEN_CHNL_DETL	VARCHAR (100) 
  , MOST_FREQ_USED_CHNL	VARCHAR (100) 
  , MOST_FREQ_USED_CHNL_DETL VARCHAR (100) 
)
;


-- Product reference table
-- a lookup table explaining eachh of the products we have on book
-- DROP TABLE ROYAL_BANK_AUS.PDCT_REF;
CREATE TABLE ROYAL_BANK_AUS.PDCT_REF
(
    PDCT_TYPE_C VARCHAR (10) PRIMARY KEY
  , PDCT_TYPE VARCHAR (100)
  , PDCT_TYPE_DETL VARCHAR (100) -- low-fee card
  , MNTH_FEE_COST INT -- fee per customer per month
  , EFFT_D DATE -- opened date 
  , EXPY_D DATE
)
;


-- Transaction
-- each row is a transaction, each column is info about that transaction
-- DROP TABLE ROYAL_BANK_AUS.TRAN;
CREATE TABLE ROYAL_BANK_AUS.TRAN
(
    TRAN_I INT PRIMARY KEY
  , ACCT_I INT -- account
  , TRAN_D DATE
  , TRAN_TYPE TINYTEXT
  , TRAN_BUSN_CATG TINYTEXT -- business category
  , TRAN_LOCN TINYTEXT -- location
  , TRAN_DESC TINYTEXT -- the name of the business and where it is
  , TRAN_A INT -- amount (positive=amount spend by the customer/outgoing, negative represents incoming money into the account)
)
;




######### SHOW THE EMPTY TABLES #########
-- Customer Base
SELECT *
FROM ROYAL_BANK_AUS.CUST_BASE
;
-- Customer Account
SELECT *
FROM ROYAL_BANK_AUS.CUST_ACCT
;
-- Account Base
SELECT *
FROM ROYAL_BANK_AUS.ACCT_BASE
;
-- Product Reference 
SELECT *
FROM ROYAL_BANK_AUS.PDCT_REF
;
-- Transaction
SELECT *
FROM ROYAL_BANK_AUS.TRAN
;


